-- Crea la base de datos
CREATE DATABASE usuarios_adea;

-- Utiliza la base de datos rec√≠en creada
USE usuarios_adea;

-- Borrar la tabla
-- SELECT * FROM USUARIO;
DROP TABLE usuario;

-- Desactivar los Safe-Update (Elimininar y Actualizar masivamente sin el Where)
-- https://masqueprogramar.wordpress.com/2015/12/23/mysql-error-code-1175/
SET SQL_SAFE_UPDATES = 0;

-- No recordaba como usar los comodines de % ni de _
-- https://www.sqlshack.com/es/introduccion-y-resumen-del-operador-logico-sql-like/
DELETE FROM USUARIO WHERE LOGIN LIKE '__1%';
SELECT * FROM USUARIO WHERE (LOGIN LIKE '__1%');

-- Crea la tabla
CREATE TABLE USUARIO(
	LOGIN VARCHAR(20) NOT NULL PRIMARY KEY,
    PASS VARCHAR(60) NOT NULL,
    NOMBRE VARCHAR(50) NOT NULL,
    CLIENTE FLOAT NOT NULL,
    
    EMAIL VARCHAR(50),
    FECHAALTA DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    FECHABAJA DATETIME,
    ESTATUS CHAR(1) NOT NULL DEFAULT 'A',
    
    INTENTOS FLOAT NOT NULL DEFAULT 0,
    FECHAREVOCADO DATETIME,
    FECHA_VIGENCIA DATETIME,
    -- No puede tener un valor vacio o null, por tanto, por defecto puse 0
    NO_ACCESO INTEGER DEFAULT 0,
    
    APELLIDO_PATERNO VARCHAR(50),
    APELLIDO_MATERNO VARCHAR(50),
    AREA NUMERIC(4),
    FECHAMODIFICACION DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
);

-- Seleccion de registros
-- SELECT * FROM usuarios_adea.usuario ORDER BY FECHAALTA DESC; 
SELECT * FROM usuarios_adea.usuario WHERE (LOGIN LIKE 'A___') ORDER BY LOGIN DESC; 

-- DELETE FROM `usuarios_adea`.`usuario` WHERE (`LOGIN` = 'A048');
SELECT u.login, u.fechaalta,u.FECHAMODIFICACION from  usuario u where login like 'A050';
SELECT * from  usuario u where login like 'A044';

-- Pruebas para Tablero.html

SELECT length(pass) from  usuario where login like 'A042';

-- Alterar la columna de PASS para que por defecto se setee 0
ALTER TABLE USUARIO MODIFY COLUMN PASS VARCHAR(60);
commit;

-- Alterar la columna de NO_ACCESO para que por defecto se setee 0
ALTER TABLE USUARIO ALTER COLUMN NO_ACCESO set default 0;
commit;

